 import { Box , TextField } from "@mui/material";
 import {styled} from "@mui/material/styles";

const Conatiner = styled(Box)`
      display: flex;
      flex-direction: column;
      width: 600px;
      box-shadow: 0 1px 2px 0 rgb(60 64 67/ 70%), 0 1px 6px 2px rgb(60 64 67/100%);
      padding: 10px 15px;
`
const Form = () => {
    return(
          <Conatiner>
            <TextField />
            <TextField />
          </Conatiner>
    )
}

export default Form;
